import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Detail() {
    const [posts, setPosts] = useState([]);

    useEffect(() => {
      axios.get('http://localhost:8000/albums/1')
        .then(response => {
          setPosts(response.data);
        })
        .catch(error => {
          console.error(error);
        });
    }, []);
  
    return (
      <ul>
        {posts.map(post => (
          <p>{}</p>
        ))}
      </ul>
    );
}

export default Detail;
